import React, { useState } from "react";
import OurForm from "./OurForm";
import Card from "./UI/Card";

const Example = (props) => {
  const getTitleHandler = (enteredTitle) => {
    const expenseDat = {
      ...enteredTitle,
    };
    props.onAddExp(expenseDat);
  };
  return (
    <Card>
      <OurForm onGetTitle={getTitleHandler} />
    </Card>
  );
};

export default Example;
